【医薬部外品】<br><br>【商品説明文】<br><br>　・胃酸に強い有胞子性乳酸菌(ラクボン原末)を4.5億個含有した整腸剤です。<br><br>　・腐敗菌などの有害細菌の増殖を抑えて、腸内環境を整え、便秘、軟便、腹部膨満感を改善します。<br><br>　・胞子に包まれたラクボン菌は酸や熱に大変強く、保存にもよく耐え、胃酸の影響を受けずに腸内に達します。<br><br>　・腸内に達するとラクボン菌は胞子を破って繁殖を始めますが、消化酵素のタカヂアスターゼN1とビオチンのサポート成分が、ラクボン菌の発育を促進し、整腸効果を高めます。<br><br>　・甘みのある飲みやすい小粒錠剤。<hr>【使用上の注意】<br><br>　●相談すること●<br><br>
　次の人は服用前に医師又は薬剤師に相談して下さい。<br>
　　・医師の治療を受けている人<br>　　・本人又は家族がアレルギー体質の人<br>
　　・薬によりアレルギー症状を起こしたことがある人<br><br>
　次の場合は、直ちに服用を中止し、この文書を持って医師又は薬剤師に相談して下さい<br> 　　・服用後、次の症状があらわれた場合<br>　　　　《関係部位》皮ふ　《症状》発疹・発赤、かゆみ<br>
　　・1ヶ月くらい服用しても症状がよくならない場合<br>
　<br><hr>【内容量】 550錠<br><br>【発売元】 第一三共ヘルスケア<br><br>区分：【医薬部外品】<br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
